import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './reception.css'

const ReceptionQueue = () => {
    // const [receptionQueue, setReceptionQueue] = useState([]);

    // useEffect(() => {
    //     const apiUrl = 'http://localhost:3000/receptionQueue';

    //     axios.get(apiUrl)
    //         .then(response => {
    //             setReceptionQueue(response.data);
    //         })
    //         .catch(error => {
    //             console.error('Error fetching reception queue data:', error);
    //         });
    // }, []); 

    // Your sample JSON data
    const sampleData = [
        {
            "uniqueNumber": "A2",
            "name": "אברהם שלום",
            "roomId": "12fhi23",
            "turnId": 2
        },
        {
            "uniqueNumber": "B1",
            "name": "מרים כהן",
            "roomId": "12fhi23",
            "turnId": 1
        },
        {
            "uniqueNumber": "C3",
            "name": "דניאל יוסף",
            "roomId": "12fhi23",
            "turnId": 3
        }
    ];
    return (
        <div>
            <h2>Reception Queue</h2>

            <table>
                <thead>
                    <tr >
                        <th>שם</th>
                        <th>מספר</th>
                    </tr>
                </thead>
                <tbody>
                    {sampleData.map(item => (
                        <tr key={item.turnId}>
                            <td>{item.name} </td>
                            <td>{item.uniqueNumber}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ReceptionQueue;
